import React from "react"

const Person = (props) => {
    return (
        <div>
            <p>Name: {props.person.name}</p>
            <p>Birth Year: {props.person.birth_year}</p>
            <p>Gender: {props.person.gender}</p>
        </div>
    )
}

export default Person
